import styles from './currencyElement.module.css';
import { ReactCountryFlag } from '@fadi-ui/react-country-flag';

export default function CurrencyElement(props) {
  return (
    <div className={styles.currency_element_container}>
      {props.iso_code ? <ReactCountryFlag countryCode={props.iso_code} width={30} height={20} /> : <img className={styles.image_not_found} src="https://www.jnckl.or.kr/assets/images/image-not-found.png"/>}
      {`환율: ${props.cur_nm}(${props.cur_unit}) 매입률(TTB): ${props.ttb} 매도율(TTS): ${props.tts}`}
    </div>
  );
}
